import React from "react";

export function Model(data, title, place) {
  return (
    <div className="model">
      <h2 className="model__name">{title}</h2>
      {data.map((nb_place, index) => {
        return (
          <h3 key={index} className="model__place">
            {nb_place} places
          </h3>
        );
      })}
    </div>
  );
}
